  useEffect(()=>{
    fetch(`https://yts.mx/api/v2/list_movies.json?minimum_rating=9&sort_by=year`)
    .then( (response) => response.json())
  }, []);
  return (
    <div>
      <h1>코인</h1>
        { loading? <strong>로딩중...</strong> : null }

    </div>
  );
}

export default App;
